    [],nt"revision_timestamp": "2016-07-27T22:38:35.484079",nt"name": "wheeler-national-wildlife-refuge-annual-narrative-report-calendar-year-2005",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Wheeler
    NWR, Key Cave NWR, Sauta Cave NWR, and Fern Cave NWR outlines activities and accomplishments
    during the 2005 calendar year. The report begins with an introduction to the Refuge.
    Highlights and weather conditions are summarized for the year. Information about
    monitoring and studies- including surveys and censuses and studies and investigations-
    is provided next. Habitat restoration and management projects are also covered;
    activities include wetland restoration, water level management, moist soil management,
    grazing/mowing/haying, farming, forest management, fire management, and vegetation
    control. Fish and wildlife management are discussed next with emphasis on bird banding,
    disease monitoring, nest structures, and animal control. Coordination activities,
    such as interagency coordination, tribal coordination, private land activities,
    and cooperative organizations, are outlined. The resource protection section provides
    an update on law enforcement, wildfire preparedness, permits, contaminants, and
    cultural resource management. Information about public education and recreation
    is given including visitor services and outreach. Finally, comprehensive management
    planning and general administration are discussed in the Refuge planning and administration
    section.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
